import React from 'react';
import NavigationButton from "./NavigationButton";
import NavigationList from "./NavigationList";


const Navigation = (props) => {
    return (
        <div className="navigation">
            <NavigationButton />
            <NavigationList />
        </div>
    );
}

export default Navigation;
